(function init($) {
  'use strict';

  var continuum = window.continuum || { };

  // Check for client-only history data in localStorage
  continuum.history = function history(key) {
    return localStorage[key];
  };

  continuum.endsWith = function endsWith(string, searchString, strpos) {
    var subjectString = string;
    var position = strpos;
    var lastIndex = 0;

    if (typeof strpos !== 'number' || !isFinite(strpos)
            || Math.floor(strpos) !== strpos || strpos > subjectString.length) {
      position = subjectString.length;
    }
    position -= searchString.length;
    lastIndex = subjectString.lastIndexOf(searchString, position);

    return lastIndex !== -1 && lastIndex === position;
  };

  continuum.homeTileProportion = 1.0924;

  continuum.resizeTiles = function resizeTiles() {
    var flipContainer = $('.subscriptions-grid .flip-container');
    var itemsResizeSelectors = '.subscriptions-grid .flip-container, '
            + '.subscriptions-grid .front, '
            + '.subscriptions-grid .back';
    var itemsToTresize = $(itemsResizeSelectors);
    var tFontSize = (($(window).width() / 1024) * 100) + '%';

    // items to calc height inside pricing table
    var pTitle = $('.pricing-table .title'); // 30%
    var pDescription = $('.pricing-table .description'); // 40%
    var pPricingSupport = $('.pricing-table .pricing-support'); // 30%

    // calc correct heights
    var flipContainerH = flipContainer.width() / continuum.homeTileProportion;
    itemsToTresize.css('height', flipContainerH + 'px');
    pTitle.css('height', ((flipContainerH - 56) * 0.3) + 'px');
    pDescription.css('height', ((flipContainerH - 56) * 0.4) + 'px');
    pPricingSupport.css('height', ((flipContainerH - 56) * 0.3) + 'px');

    if ($(window).width() < 1024 && $(window).width() > 768) {
      // decrease font size

      pTitle.find('h4').css('font-size', tFontSize);
      pDescription.css('font-size', tFontSize);
      pPricingSupport.css('font-size', tFontSize);
    } else {
      pTitle.find('h4').css('font-size', '');
      pDescription.css('font-size', '');
      pPricingSupport.css('font-size', '');
    }
  };

  continuum.stickySideBar = function stickySideBar() {
    var $stick = $('aside');
    var $footer = $('footer');
    var $main = $('main');
    var offtop = $stick.offset().top;
    var menuHeight = $stick.find('.pane-node-field-doc-navigation-menu').height();

    if ($main.height() < menuHeight) {
      $main.css('height', (menuHeight + 30) + 'px');
    }
    $(window).scroll(function () {
      var scrtop = $(window).scrollTop();
      var offbtm = $footer.offset().top - $(window).height();

      if (scrtop > offtop && $stick.hasClass('natural')) {
        $stick.removeClass('natural').addClass('fixed').css('top', 0);
      }
      if (offtop > scrtop && $stick.hasClass('fixed')) {
        $stick.removeClass('fixed').addClass('natural').css('top', 'auto');
      }
      if (offbtm > scrtop && $stick.hasClass('bottom')) {
        $stick.removeClass('bottom').addClass('fixed').css('top', 0);
      }
    });
  };

  $(document).ready(function onReady() {
    $(document).foundation({
      equalizer: {
        equalize_on_stack: true
      }
    });

    // toggle left menu
    $('.breadcrumb-wrapper .toggle-sidebar').click(function toggleLeftMenu() {
      if ($(window).width() > 799) {
        $('body').toggleClass('sidebar-collapsed');
        $('body').removeClass('sidebar-expanded');
      } else {
        $('body').toggleClass('sidebar-expanded');
        $('body').removeClass('sidebar-collapsed');
      }
      continuum.resizeTiles();
    });

    $('.layout-two-col__second .sidebar-close').click(function () {
      $('body').removeClass('sidebar-expanded');
      $('body').removeClass('sidebar-collapsed');
    });

    // smooth anchor scroll
    $('a[href*="#"]:not([href="#"])').not('.tab-title > a').click(function smoothAScroll() {
      var target = $(this.hash);

      if (location.pathname.replace(/^\//, '') === this.pathname.replace(/^\//, '')
              && location.hostname === this.hostname) {
        target = target.length ? target : $('[name=' + this.hash.slice(1) + ']');
        if (target.length) {
          $('html, body').animate({
            scrollTop: target.offset().top
          }, 1000);
        }
      }
    });

    // scroll pane for syntax blocks
    $('.highlight').addClass('horizontal-only scroll-pane');

    $('.scroll-pane').jScrollPane({ autoReinitialise: true });
    $('.scroll-pane').each(
            function () {
              var api = $(this).data('jsp');
              var throttleTimeout;

              $(this).jScrollPane({ autoReinitialise: true });

              $(window).bind(
                      'resize',
                      function () {
                        if (!throttleTimeout) {
                          throttleTimeout = setTimeout(
                                  function () {
                                    api.reinitialise();
                                    throttleTimeout = null;
                                  }
                          );
                        }
                      }
              );
            }
    );

    // stylize external links
    $('a').each(function () {
      var comp = new RegExp(location.host);
      var ahref = $(this).attr('href');
      if (ahref) {
        if (!comp.test(ahref) && ahref.indexOf('http') === 0 && $(this).html().indexOf('<') === -1 && ahref.indexOf('http://docs.continuum.io') === -1) {
          $(this).addClass('url-external');
          $(this).prop('target', '_blank');
        }
      }
    });

    // temp menu hack: remove dashes and add arrows for menus with dashes only
    $('.pane-node-field-doc-navigation-menu ul > li').each(function (e) {
      var nlink = $(this).find('> a');
      // treat section links
      if (nlink.html() === 'Anaconda Platform'
              || nlink.html() === 'Top OSS programs'
              || nlink.html() === 'Continuum-sponsored OSS programs') {
        $(this).removeClass('toctree-l1');
        $(this).addClass('menu-bold');
        if (nlink.html() === 'Anaconda Platform') {
          $(this).html('<span class="nolink">Anaconda Platform</span>');
          nlink = false;
        }
      }

      // remove dashes
      if (nlink && nlink.html().indexOf('\u2013 ') === 0) {
        nlink.html(nlink.html().substring(2));
      }

      if (nlink && (nlink.html() === 'Welcome' || nlink.hasClass('url-external'))) {
        $(this).removeClass('toctree-l1');
      }
    });

    // toggle expanded left menu section
    $('.pane-node-field-doc-navigation-menu ul.current li.current').each(function (e) {
      var thisLi = $(this);
      var thisLink = thisLi.find('> a');
      var parentMenu = thisLi.find('> ul');

      if (parentMenu.length && thisLink.attr('href').length < 2) {
        thisLink.click(function () {
          parentMenu.toggle();
          thisLink.toggleClass('arr_right');
        });
      }
    });

    // was this helpful form - show submit on radio select and reset equalized cols
    $('.helpful-form input[name="submitted[was_this_helpful]"]').click(function () {
      $('.helpful-form .webform-submit').show();
      $('.layout-two-col__first').css('height', 'auto');
      $(document).foundation('equalizer', 'reflow');
    });

    // toggle visibility
    $('.show-more').click(function () {
      $('.' + $(this).data('show-cls')).toggle();
      $(this).html($('.' + $(this).data('show-cls')).is(':visible') ?
              $(this).data('txt-hide') : $(this).data('txt-more'));
      $(document).foundation('equalizer', 'reflow');
    });

    if ($(window).width() > 640) {
      // sticky sidebar
      continuum.stickySideBar();
    }

    // resize home tiles proportional to flip back images
    continuum.resizeTiles();
    $(window).resize(function () {
      continuum.resizeTiles();
    });

    // flip on click only
    $('.subscriptions-grid .flip-container').click(function () {
      $(this).toggleClass('hover');
    });

    // treat search input to prevent nginx 403 error
    $('#apachesolr-panels-search-form').submit(function () {
      var searchInput = $(this).find('input[name="apachesolr_panels_search_form"]');
      var searchVal = searchInput.val();

      // replace trailing .sh with _space_sh
      if (continuum.endsWith(searchVal, '.sh')) {
        searchInput.val(searchVal.replace('.sh', ' sh'));
        searchInput.attr('readonly', 'true');
      }
    });
  });
})(jQuery);
;/**/
(function ($) {
  'use strict';

  var doc = $(document);

  // Initialize Foundation plugins
  doc.foundation({
    accordion: {
      // specify the class used for accordion panels
      content_class: 'content',
      // specify the class used for active (or open) accordion panels
      active_class: 'active',
      // allow multiple accordion panels to be active at the same time
      multi_expand: false,
      // allow accordion panels to be closed by clicking on their headers
      // setting to false only closes accordion panels when another is opened
      toggleable: true
    },
    equalizer : {
      equalize_on_stack: false,
    }
  });

  // 'Reflow' foundation elements as needed
  doc
    .on('click', '.accordion', function (event) {
      doc.foundation('equalizer', 'reflow');
    })
    .on('mouseover', '.alert-box', function (event) {
      doc.foundation('alert', 'reflow');
    });

})(jQuery);
;/**/
